import Footer from "./components/Footer";
import Header from "./components/Header";
import Cart from "./components/Cart";
import Login from "./components/Login";
import Register from "./components/Register";
import Products from "./components/Products";
import Orders from "./components/Orders";
import { createContext } from "react";
import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
export const appContext = createContext();
function App(props) {
  const [users, setUsers] = useState([]);
  const [user, setUser] = useState({});
  const [cart, setCart] = useState({});
  const [orders, setOrders] = useState([])
  const products = [
    { id: 1, name: "Coffee", price: 20,imgUrl:"data:image/jpeg;base64,"},
    { id: 2, name: "Pizza", price: 40 ,imgUrl:"data:image/jpeg;base64,"},
    { id: 3, name: "Mocktails", price: 45,imgUrl:"data:image/jpeg;base64," },
    { id: 4, name: "Breads", price: 95,imgUrl:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTTCoST4GG_E_hA88Fd7RSBS5jZXmoMwdQznQ&s" },
    { id: 5, name: "Pasta", price: 70 ,imgUrl:"data:image/jpeg;base64,"},
    { id: 6, name: "Cheesecakes", price: 25,imgUrl:"data:image/jpeg;base64," },
  ];
  return (
    <BrowserRouter>
      <appContext.Provider
        value={{ users, setUsers, user, setUser, products, cart, setCart, orders, setOrders }}
      >
        <Header />
        <Routes>
          <Route index element={<Products />} />
          <Route path="/" element={<Products />} />
          <Route path="cart" element={<Cart />} />
          <Route path="orders" element={<Orders />} />
          <Route path="login" element={<Login />} />
          <Route path="register" element={<Register />} />
        </Routes>
        <Footer />
      </appContext.Provider>
    </BrowserRouter>
  );
}
export default App;